sourcesContent:
import redisClient from './utils/redis';

(async () => {
    console.log(redisClient.isAlive()); // Should print true if Redis is connected
    console.log(await redisClient.get('myKey')); // Should print null initially
    await redisClient.set('myKey', 12, 5); // Sets 'myKey' with value 12 and expiration of 5 seconds
    console.log(await redisClient.get('myKey')); // Should print 12

    setTimeout(async () => {
        console.log(await redisClient.get('myKey')); // Should print null after 10 seconds as the key would have expired
    }, 1000 * 10);
})();

