import redis from 'redis';
import { promisify } from 'util';

class RedisClient {
    constructor() {
        // Create a Redis client
        this.client = redis.createClient();

        // Handle errors
        this.client.on('error', (err) => {
            console.error(`Redis client not connected to the server: ${err.message}`);
        });
    }

    isAlive() {
        // Check if the Redis client is connected
        return this.client.connected;
    }

    async get(key) {
        // Promisify and use the get method of Redis client
        const getAsync = promisify(this.client.get).bind(this.client);
        try {
            const value = await getAsync(key);
            return value;
        } catch (err) {
            console.error(`Error getting value for key ${key}: ${err.message}`);
            return null;
        }
    }

    async set(key, value, duration) {
        // Promisify and use the setex (set with expiration) method of Redis client
        const setAsync = promisify(this.client.setex).bind(this.client);
        try {
            await setAsync(key, duration, value);
        } catch (err) {
            console.error(`Error setting value for key ${key}: ${err.message}`);
        }
    }

    async del(key) {
        // Promisify and use the del method of Redis client
        const delAsync = promisify(this.client.del).bind(this.client);
        try {
            await delAsync(key);
        } catch (err) {
            console.error(`Error deleting key ${key}: ${err.message}`);
        }
    }
}

// Create and export an instance of RedisClient
const redisClient = new RedisClient();
export default redisClient;

